                <p>|</p>
            

            
                <a id="support-link" href="/not-found" target="blank">Support</a>
                <p>|</p>
            

            
                <a id="support-link" href="/not-found" target="blank"> About</a>
                <p>|</p>
            

            
                <a id="support-link" href="/not-found" target="blank">Login</a>
            
        </div>

    );
}

export default SupportNav;




